import React from "react";
import NavBar from "./navbar";
import { SearchIcon } from "./icons";
class Products extends React.Component {
  render() {
    return (
      <div>
        {" "}
        <NavBar
          color="black"
          active="products"
          navHidden={this.props.navHidden}
          hideNav={this.props.hideNav}
          switchNavState={this.props.switchNavState}
        />
        {/* Search */}
        <div className="bg-red-00 pt-36 pb-20 px-2 md:flex items-center justify-center">
          <div className="bg-white border-2 border-gray-400 flex h-12 items-center rounded-md max-w-xl md:w-2/3 md:ml-10">
            <div className="mx-5 md:mx-10">
              <SearchIcon
                height={25}
                width={25}
                color="rgba(68, 68, 68, 0.7)"
              />
            </div>
            <input
              type="text"
              placeholder="Search products, brands and categories"
              className="text-xs h-8 w-full focus:outline-none"
            />
          </div>
          <button className="text-sm block text-white h-10 w-28 bg-yellow-500 rounded-md mt-2 md:mt-0 tracking-wide md:mx-4 py-1">
            SEARCH
          </button>
        </div>
        <div className="bg-red-500 text-white">
          <div className="categories bg-white text-gray-500 font-semibold shadow-lg w- m-auto md:m-0 rounded-lg py-5 pl-10 pb-20">
            <div className="my-5 text-blue-700">All Categories</div>
            <div className="my-5">Laptops</div>
            <div className="my-5">Phones</div>
            <div className="my-5">Smart Devices</div>
            <div className="my-5">Accessories</div>
          </div>
          <div className="images">
            <div className="text-lg">MEET THE APPLE MAC BOOK PRO 2020</div>
            <div>
              Enjoy great speed, large memory space, optimized performance, high
              graphic reolution and lots more in one PC
            </div>
            <button className="bg-yellow-500">VIEW PRODUCT</button>
          </div>
        </div>
      </div>
    );
  }
}

export default Products;
